import React from 'react';
import Header from './components/Header'
import Sidebar from './components/Sidebar'
import { BrowserRouter, Switch, Route } from 'react-router-dom'

import './App.css';

function App() {
	return (
		<div className="app">
			<BrowserRouter>
				<Header />
				<div className='app__body'>
					<Sidebar />
					<Switch>
						<Route path="/room/:roomID">
							<h1>chat</h1>
						</Route>
						<Route path="/">
							<h1>welcome</h1>
						</Route>
					</Switch>
				</div>
			</BrowserRouter>
		</div>
	);
}

export default App;
